const Pagination = (props) => {
  const pageNumbers = [];

  const paginate = () => {
    for (var i = 1; i <= Math.ceil(props.pages / 100); i++) {
      pageNumbers.push(i);
    }
  };
  return (
    <div>
      {paginate()}
      {console.log((props.pages))}
      <div id="pagination">

      </div>

    </div>
  );
};

export default Pagination;
